class Solution(object):
    def uniquePathsCizi(self, m, n):
        dp = [1]*n
        for i in range(1,m):
            for j in range(1,n):
                dp[j]=dp[j]+dp[j-1]
        return dp[-1]

    def uniquePaths(self, m, n):
        """
        :type m: int
        :type n: int
        :rtype: int
        """
        mysledky = [[1 for col in range(n)] for row in range(m)]
        for r in range(1, m):
            for c in range(1, n):
                mysledky[r][c] = mysledky[r - 1][c] + mysledky[r][c - 1]
        return mysledky[m - 1][n - 1]

    def uniquePathsLazy(self, m, n):
        """
        :type m: int
        :type n: int
        :rtype: int
        """
        return VVV[m - 1][n - 1]

